import React from "react";
import ReactDOM from "react-dom";

class Footer extends React.Component {
  render() {
    return (
      <div style={{ backgroundColor: "#f5f8fd" }}>
        <div className="container pt-5">
          <div className="col-md-6">
            <div className="col-md-6">
              <p className="text-uppercase h1 font-weight-light"> rapid </p>
              <div className="text-muted pt-3 pb-3 small">
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Officia
                dicta nemo sed ducimus quisquam. Impedit cumque totam deleniti
                optio voluptatem nobis, tempore sed a expedita. Eveniet
                exercitationem autem atque ab?
              </div>

              <p> our newsletter</p>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Footer;
